import React from "react";
import './App.css';
import { HashRouter, Route, Router } from "react-router-dom";
import About from './routers/About';
import Home from './routers/Home';

function App() {
  return (
  <HashRouter>
    <Route path="/" component={Home} />
    <Route path="/about" component={About}/>
  </HashRouter>
  );
}

export default App;
